const e=JSON.parse('{"key":"v-1f453882","path":"/08.advanced-topics/03.using-proposed-api.html","title":"使用不稳定的API","lang":"zh-CN","frontmatter":{"summary":"使用不稳定的API 在VS Code中，插件API的兼容性非常重要，我们尽最大努力避免API变动以便插件开发人员已经发布的插件可以按预期工作。但是，这对使得我们束手束脚，一旦新的API发布后，就不可能再轻易改动。 不稳定的API（Proposed API）则解决了这个问题，不稳定的API是VS Code已经实现但是还未公开的API。它们只在Insider版的","head":[["meta",{"property":"og:url","content":"https://oorzc.cn/08.advanced-topics/03.using-proposed-api.html"}],["meta",{"property":"og:site_name","content":"vscode插件开发文档"}],["meta",{"property":"og:title","content":"使用不稳定的API"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}]]},"excerpt":"","headers":[{"level":2,"title":"使用不稳定的API","slug":"使用不稳定的api-1","link":"#使用不稳定的api-1","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":0.93,"words":279},"filePathRelative":"08.advanced-topics/03.using-proposed-api.md"}');export{e as data};
